import React, { Component, Fragment } from 'react';
import './App.css';
import BadgeCard from './components/BadgeCard/index';
import Bootstrap from "./components/Bootstrap/index";
import Badges from "./Badges.json";
// import footer from './components/Footer/index';


function App() {
  return (
    <React.Fragment>
 <Bootstrap />
 <row>
 <BadgeCard
 image={Badges[0].image}
 />
 <BadgeCard
 image={Badges[1].image}
 />
 <BadgeCard
 image={Badges[2].image}
 />
 <BadgeCard
 image={Badges[3].image}
 />
 </row>
 <row>
 <BadgeCard
 image={Badges[4].image}
 />
 <BadgeCard
 image={Badges[5].image}
 />
 <BadgeCard
 image={Badges[6].image}
 />
 <BadgeCard
 image={Badges[7].image}
 />
 </row>
 <footer />
 </React.Fragment>
  );
}

export default App;
